import React from 'react';

const Card = (props) => {
    return(
        <div>
            <div className="card">
                <div className="top">
                    <h2 className='name'>{props.name}</h2>
                    <img
                        src={props.imgURL}
                        alt="avatar_img"
                        className='circle-img'
                    />
                </div>
                <div className="bottom">
                    <p className="info">{props.phone}</p>
                    <p className="info">b@beyonce.com</p>
                </div>
            </div>
        </div>
    );
}

export default Card;
